contract Events{

    event ReceivedToken(
        address from, 
        address to,
        uint amount, 
        string message
    );

    event MinimumTokenRequired(
        address from,
        address to, 
        uint amount
    );

    event InternalError(
        address from, 
        address to,
        string message
    );

    event TokensWithdrawn(
        address from,
        address to,
        uint amount
    );
}

